const RestaurantListItem = ({ attributes }) => {
  const { name, cuisines, address } = attributes;
  return (
    <li>
      <h3>{name}</h3>
      <p>
        {address.data.attributes.building}, {address.data.attributes.city}{" "}
        {address.data.attributes.postal_code}
      </p>
      <ul>
        {cuisines.data.map((cuisine, index) => (
          <li key={index}>{cuisine.attributes.name}</li>
        ))}
      </ul>
    </li>
  );
};

export default RestaurantListItem;
